parts.text:
[
  {
    "id": "signature-line-modal",
    "type": "modal",
    "text": "Linha de assinatura",
    "region": "main-content",
    "meta": {
      "title": "Linha de assinatura"
    },
    "components": [
      {
        "id": "modal-icon-document",
        "type": "icon",
        "text": "Ícone de documento",
        "region": "modal-header"
      },
      {
        "id": "modal-button-minimize",
        "type": "button",
        "text": "Minimizar",
        "region": "modal-header",
        "actions": ["onClick"]
      },
      {
        "id": "modal-button-maximize",
        "type": "button",
        "text": "Maximizar/Restaurar",
        "region": "modal-header",
        "actions": ["onClick"]
      },
      {
        "id": "modal-button-close",
        "type": "button",
        "text": "Fechar",
        "region": "modal-header",
        "actions": ["onClick"]
      },
      {
        "id": "section-suggested-signer",
        "type": "label",
        "text": "Signatário sugerido",
        "region": "modal-body"
      },
      {
        "id": "label-name",
        "type": "label",
        "text": "Nome:",
        "region": "modal-body"
      },
      {
        "id": "input-name",
        "type": "input",
        "text": "José da Silva",
        "state": "filled",
        "region": "modal-body",
        "actions": ["onChange", "onFocus", "onBlur"]
      },
      {
        "id": "label-title",
        "type": "label",
        "text": "Título:",
        "region": "modal-body"
      },
      {
        "id": "input-title",
        "type": "input",
        "text": "Diretor",
        "state": "filled",
        "region": "modal-body",
        "actions": ["onChange", "onFocus", "onBlur"]
      },
      {
        "id": "label-email",
        "type": "label",
        "text": "E-mail:",
        "region": "modal-body"
      },
      {
        "id": "input-email",
        "type": "input",
        "text": "silva@exemplo.org",
        "state": "filled",
        "region": "modal-body",
        "actions": ["onChange", "onFocus", "onBlur"],
        "meta": {
          "inputType": "email"
        }
      },
      {
        "id": "section-more-options",
        "type": "label",
        "text": "Mais",
        "region": "modal-body"
      },
      {
        "id": "checkbox-signer-can-add-notes",
        "type": "checkbox",
        "text": "Signatário pode adicionar anotações",
        "state": "checked",
        "region": "modal-body",
        "actions": ["onChange"]
      },
      {
        "id": "checkbox-show-date-on-signature-line",
        "type": "checkbox",
        "text": "Mostrar data da assinatura na linha de assinatura",
        "state": "checked",
        "region": "modal-body",
        "actions": ["onChange"]
      },
      {
        "id": "label-instructions-for-signer",
        "type": "label",
        "text": "Instruções para o signatário:",
        "region": "modal-body"
      },
      {
        "id": "textarea-instructions-for-signer",
        "type": "textarea",
        "text": "",
        "state": "empty",
        "region": "modal-body",
        "actions": ["onChange", "onFocus", "onBlur"]
      },
      {
        "id": "button-help",
        "type": "button",
        "text": "Ajuda",
        "state": "enabled",
        "region": "modal-footer",
        "actions": ["onClick"]
      },
      {
        "id": "button-ok",
        "type": "button",
        "text": "OK",
        "state": "enabled",
        "region": "modal-footer",
        "actions": ["onClick"],
        "meta": {
          "isPrimary": true
        }
      },
      {
        "id": "button-cancel",
        "type": "button",
        "text": "Cancelar",
        "state": "enabled",
        "region": "modal-footer",
        "actions": ["onClick"]
      }
    ]
  }
]
